import React, { useState } from "react";

const App = () =>{
    const [num,setNum] = useState();

    return (
        <div className="main_div">
            <select value={num} >
                <option value="1"> 1</option>
                <option value="2"> 2</option>
                <option value="3"> 3</option>
                <option value="4"> 4</option>
                <option value="5"> 5</option>
            </select>
        </div>
    )
}

export default App;
